  font-size: 14px;
}
.font-md {
 font-size: 22px;
}
.font-lg {
  font-size: 29px;
}

*, *:before, *:after {
  box-sizing: inherit;
}

h1, h2, h3, h4, h5, h6, p, a, span {
  -webkit-font-smoothing: antialiased;
  -moz-osx-font-smoothing: grayscale;
}
a, a:visited {
  text-decoration: none;
}
ul, li {
  list-style-type: none;
  margin: 0;
  padding: 0;
}
li {
  display: list-item;
  text-align: -webkit-match-parent;
}
main {
  margin-top: 38px;
  position: relative;
}
input {
  box-sizing : border-box;
  font-size: 14px;
}
input[type='text'], input[type='password'] {
  white-space: pre-wrap;
}

h2.title, h2 {
  margin-bottom: 10px;
  margin-left: $margin;
}
button, a, .modal-close, form input, form textarea {
  transition: opacity 0.5s cubic-bezier(0.77, 0, 0.175, 1), -webkit-transform 0.1s cubic-bezier(0.77, 0, 0.175, 1);
  transition: opacity 0.5s cubic-bezier(0.77, 0, 0.175, 1), transform 0.1s cubic-bezier(0.77, 0, 0.175, 1);
  transition: opacity 0.5s cubic-bezier(0.77, 0, 0.175, 1), transform 0.1s cubic-bezier(0.77, 0, 0.175, 1), -webkit-transform 0.1s cubic-bezier(0.77, 0, 0.175, 1);
}
button:focus, a:focus, {
  outline: none;
}
button, a, link {
  cursor: pointer !important;
}
@media only screen and (min-width: 371px) {
  .title {
    margin-bottom: $margin;
  }
}
@media screen and (-webkit-min-device-pixel-ratio: 2), screen and (min-resolution: 2dppx) {
	body {
		-moz-osx-font-smoothing: grayscale;
		-webkit-font-smoothing: antialiased;
	}
}

