// @import './../lib/vars'; 
header {
  background-color: #FFF;
  position: fixed;
  top: 0;
  left: 0;
  width: 100%;
  z-index: 1500;
  box-shadow: 0 1px 4px 0 rgba(0,0,0,.25);
  min-height: 50px;
  transition: transform .2s linear;
  font-size: 17px;
  line-height: 1.59;
  color: #111;
}
.navPrimary {
  width: auto;
  position: relative;
  height: 50px;
  background-color: #008FD7;
  overflow: hidden;
  padding: 7.5px 0 0 19px;
  z-index: 1000;
}
.navPrimary-toggle {
  position: relative;
  top: 10px;
  width: 20px;
  height: 15px;
  float: left;
  margin-right: 14px;
  display: block;
  cursor: pointer;
}
.navPrimary-toggle span:nth-child(1) {
  top: 0;
}
.navPrimary-toggle span:nth-child(2) {
  top: 6px;
}
.navPrimary-toggle span:nth-child(3) {
  top: 6px;
}
.navPrimary-toggle span:nth-child(4) {
