sources.style/components/_modal.scss:
@import './../lib/vars'; 

.modal {
  position: fixed;
  z-index: 1501;
  top: 0;
  left: 0;
  width: 100%;
  height: 100%;
  transition: all 0.3s 0.12s;
}
.modal-overlay {
  position: fixed;
  top: 0;
  left: 0;
  width: 100%;
  height: 100%;
  background: hsla(0, 0%, 0%, 0.5);
  transition: visibility 0s linear 0.3s, opacity 0.3s;
}
.modal-wrapper {
  position: absolute;
  background-color: #fff;
  top: 50%;
  left: 50%;
  box-shadow: 0 0 1.5em rgba(0, 0, 0, 0.35);
  -webkit-transform: translate(-50%, -50%);
  -ms-transform: translate(-50%, -50%);
  transform: translate(-50%, -50%);
  width: 80vw;
  max-width: 700px;
  border-radius: 10px;
  max-height: 100vh;
//   overflow: scroll;
}
.modal-header {
  padding: 20px;
}
.modal-content {
  padding: 0 3vw 3vw 3vw;
  margin-bottom: 40px;
}
.modal-heading {
  text-align: center;
  text-transform: uppercase;
  color: #1d1e1f;
  font-size: 20px;
  font-weight: 700;
  line-height: 1;
  margin-top: 15px;
  padding-right: 20px;
}
.modal-close {
  position: fixed;
  top: 0;
  right: 0;
  z-index: 2;
  width: 44px;
  text-align: center;
  padding: 5px;
  cursor: pointer;
}
.modal-close::before{
  color: #cbccce;
  font-size: 16px;
  line-height: 36px;
  content: "X";
}
.modal-close:hover {
  background: rgba(0,0,0,.05);
}
.messageBoardModalContainer {

  .modal-header{
    position: fixed;
    top: 0;
    left: 0;
    width: 100%;
    background: #fff;
    height: 90px;
    padding: 3vw;
  }
  .modal-wrapper {
    max-width: 100vw;
    width: 100vw;
    height: 100vh;
  }
  .modal-body {
    overflow-y: scroll;
  }
  .modal-content {
    position: absolute;
    top: 90px;
    height: calc((100vh - 90px));
    overflow: scroll;
    padding: 0 3vw 3vw 3vw;
    width: 100%;
  }
}
@media (min-width: 768px) {
  .modal-heading {
      font-size: 24px;
  }
}

.modal {
  .userauth-form, .profile-form {
    font-size: 17px;
    line-height: 1.59;
    color: #3c3c3c;
    width: calc((100vw - 65px));
    margin: auto;

    h2.title {
      margin-bottom: 15px;
      font-size: 17px;
      color: #111;
      line-height: 1.2;
      font-weight: 600;
      margin: 0 0 15px !important;
    }
    input {
      font-size: 13px;
      background-color: transparent !important;
      border: 1px solid #dfe4e4;
      border-radius: 2px;
      box-shadow: none;
      display: block;
      box-sizing: border-box;
      width: 74vw;
      height: 39px;
      padding: 8px;
      margin: 0 0 24px;
      color: #000;
      transition: box-shadow .5s,border-color .25s ease-in-out;
      -webkit-appearance: none;
      appearance: none;
    }
    input:active, input:focus {
      border: 1px solid #111;
      box-shadow: 0 0 5px #afafaf;
      -webkit-box-shadow: 0 0 5px #afafaf;
      transition: box-shadow .5s,border-color .25s ease-in-out;
    }
  }
  .buttonAuthFormParentDiv {
    width: 74vw;
  }
  button {
    float: right;
  }
  .userauth-buttons button {
    margin-right: 20px;
  }
  .formButton {
    width: calc((74vw - 20px) / 2);
  }
}

@media (min-width: 875px) {
  .modal .userauth-form input, .modal .profile-form input, .modal .buttonAuthFormParentDiv {
    width: calc((700px - 6vw));
  }
  .modal .formButton {
    width: calc((340px - 3vw));
  }
  .modal-content {
    margin-bottom: 24px;
  }
}

